import React from 'react';
import './SampleApp.css';
import Header from './../../Components/Header/Header';
import SearchBox from './../../Components/SearchBox/SearchBox';
import TextLogo from './../../Components/TextLogo/TextLogo';
import Cart from './../../Components/Cart/Cart';
import ListProduct from './../ListProduct/ListProduct';

class SampleApp extends React.Component {
  state = {
    listProduct: {
      food: [
        { name: "Indomie Goreng/Rebus", price: 5000, image: "data:image/jpeg;base64," },
        { name: "Bakso Mantap", price: 12000, image: "data:image/jpeg;base64," },
        { name: "Nasi Goreng", price: 15000, image: "data:image/jpeg;base64," },
        { name: "Martabak Telor Special", price: 24000, image: "data:image/jpeg;base64," },
        { name: "Gorengan", price: 2000, image: "data:image/jpeg;base64," }
      ],
      drink: [
        { name: "Kopi Item", price: 3000, image: "data:image/jpeg;base64," },
        { name: "Susu Segar", price: 4000, image: "https://i2.wp.com/www.bralink.id/wp-content/uploads/2018/09/img_20180920_165528-742872048.jpg?resize=618%2C464" },
        { name: "Tea Jus Gula Batu", price: 1500, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS9E0aPT57Ipv0PuvIkhPzzS-lzKc398ruRCw&usqp=CAU" },
        { name: "Panther Gelas", price: 1000, image: "https://cdn0-production-images-kly.akamaized.net/zz8jkbbH9CQo38Uvbty9Y-CqRc4=/680x383/smart/filters:quality(75):strip_icc():format(webp)/kly-media-production/medias/2422490/original/092283900_1542903737-18010-panther-energy-drink-mengembalikan-energi-dan-memulihkan-stamina-020144.jpg" },
        { name: "Aqua Botol", price: 5000, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjNs7vnF8QY3awGO4_gCCiKLYjwkNWZF5caw&usqp=CAU" }
      ]
    },

    listFilter: [ ],

    cartCounter: 0
  }

  componentDidMount(){ this.setState({ listFilter: [...this.state['listProduct']['food']].concat([...this.state['listProduct']['drink']])}); }

  addToCart = (value) => { this.setState({ cartCounter: this.state.cartCounter + value }) }

  filterSearch = (value) => {
    if (this.state['listProduct'][value] === undefined) {
      this.setState({ listFilter: [...this.state['listProduct']['food']].concat([...this.state['listProduct']['drink']]) });
    } else {
      this.setState({ listFilter: [...this.state['listProduct'][value]] });
    }
  }

  render() {
    return (
      <div className="sample-app">
        <Header>
          <TextLogo />
          <SearchBox actionSearch={this.filterSearch} />
          <Cart cartCounter={this.state.cartCounter} />
        </Header>
        <ListProduct list={this.state['listFilter']} addToCart={this.addToCart} />
      </div>
    )
  }
}

export default SampleApp